import React from "react";
import { List, ListDescription } from "semantic-ui-react";

const Books = ({ books }) => {
  return (
    <List>
      {books.map((book) => {
        return <List.Item key={book.name}></List.Item>;
      })}
    </List>
  );
};

export default Books;
